Desc:
LIES: DIARY OF AN ESCORT is an in-depth story of an independent working girl. Going from client to client, Breanne Benson lies to conform to their desires. Sunny Leone tries to protect her roommate and lover, but Breanne`s selfish ways are blinded by money. What she chooses in the end, will change Sunny forever.
